import React from "react";

function Game() {
	return (
		<div id="parent">
			<div id="wrapper" style="position:relative">
				<iframe
					styles="position:absolute;top:0px;width:100%;height:100vh;"
					src="https://i.simmer.io/@Xenolht/cali-jam"
				></iframe>
			</div>
		</div>
	);
}

export default Game;
